CREATE TABLE "meal_type" (
   id        INTEGER  NOT NULL PRIMARY KEY,
   meal_type VARCHAR(7) NOT NULL
);

CREATE TABLE "meal" (
  id            INTEGER  NOT NULL PRIMARY KEY,
  restaurant_id INTEGER  NOT NULL,
  meal_type_id  INTEGER  NOT NULL REFERENCES meal_type(id),
  price         NUMERIC NOT NULL
);

CREATE TABLE "city" (
  id            INTEGER  NOT NULL PRIMARY KEY,
  city_name     VARCHAR(28) NOT NULL
);

CREATE TABLE "member" (
  id             INTEGER  NOT NULL PRIMARY KEY,
  first_name     VARCHAR(10) NOT NULL,
  surname        VARCHAR(11) NOT NULL,
  sex            VARCHAR(1) NOT NULL,
  email          VARCHAR(28) NOT NULL,
  city_id        INTEGER NOT NULL references city(id),
  monthly_budget NUMERIC(6,1) NOT NULL
);

CREATE TABLE "monthly_member_totals" (
  member_id      INTEGER NOT NULL references member(id),
  year           INTEGER  NOT NULL,
  month          INTEGER  NOT NULL,
  order_count    INTEGER  NOT NULL,
  meals_count    INTEGER  NOT NULL,
  monthly_budget VARCHAR(18) NOT NULL,
  total_expense  NUMERIC(6,1) NOT NULL,
  balance        VARCHAR(19) NOT NULL,
  commission     VARCHAR(18) NOT NULL,
  PRIMARY KEY (member_id, year, month)
);

CREATE TABLE "restaurant_type" (
   id              INTEGER  NOT NULL PRIMARY KEY,
   restaurant_type VARCHAR(9) NOT NULL
);

CREATE TABLE "restaurant" (
   id                 INTEGER  NOT NULL PRIMARY KEY,
   restaurant_name    VARCHAR(13) NOT NULL,
   restaurant_type_id INTEGER  NOT NULL references restaurant_type(id),
   income_percentage  NUMERIC(5,3) NOT NULL,
   city_id            INTEGER  NOT NULL references city(id)
);

CREATE TABLE "order" (
   id            INTEGER  NOT NULL PRIMARY KEY,
   order_date    DATE  NOT NULL,
   order_hour    VARCHAR(16) NOT NULL,
   member_id     INTEGER  NOT NULL references member(id),
   restaurant_id INTEGER  NOT NULL references restaurant(id),
   total_order   VARCHAR(18) NOT NULL
);

CREATE TABLE "order_meals" (
   id       INTEGER  NOT NULL PRIMARY KEY,
   order_id INTEGER  NOT NULL references "order"(id),
   meal_id  INTEGER  NOT NULL references meal(id)
);



